(maindata, torrent) => {
  const categoryList = ["keep"];
  const stateList = ["downloading", "stalledDL"];
  const { state, category, progress, downloadSpeed, uploadSpeed, seeder } =
    torrent;
  if (categoryList.indexOf(category) !== -1) {
    return false;
  }
  if (
    stateList.indexOf(state) !== -1 &&
    seeder >= 5 &&
    progress >= 0.5 &&
    progress <= 0.9 &&
    downloadSpeed / uploadSpeed >= 2
  ) {
    return true;
  }

  return false;
